// 进度条方法
function createProgress(total, completed, width) {
    const context = new DrawContext()
    context.size = new Size(width, h)
    context.opaque = false
    context.respectScreenScale = true
    context.setFillColor(ThemeColor.jdbgColor)
    const path = new Path()
    path.addRoundedRect(new Rect(0, 0, width, h), 1, 1)
    context.addPath(path)
    context.fillPath()
    const progressbar = width * completed / total

    if (progressbar / width >= 1) {
        context.setFillColor(ThemeColor.labelColor)
    } else {
        context.setFillColor(ThemeColor.jdyhColor)
    }
    const path1 = new Path()

    path1.addRoundedRect(new Rect(0, 0, width * completed / total, h), 1, 1)

    context.addPath(path1)
    context.fillPath()

    return context.getImage()
}

// 圆环进度条方法
function makeCircle(radiusOffset, bgCircleColor, fgCircleColor, degree) {
    let ctr = new Point(canvSize / 2, canvSize / 2)
    CoordOffset = 0
    bgx = ctr.x - (canvRadius - radiusOffset);
    bgy = ctr.y - (canvRadius - radiusOffset);
    bgd = 2 * (canvRadius - radiusOffset);
    bgr = new Rect(
        bgx + CoordOffset,
        bgy + CoordOffset + 20,
        bgd,
        bgd
    )

    canvas.setStrokeColor(bgCircleColor)
    canvas.setLineWidth(canvWidth)
    canvas.strokeEllipse(bgr)

    // Inner circle
    canvas.setFillColor(fgCircleColor)
    for (t = 0; t < degree; t++) {
        rect_x = ctr.x + (canvRadius - radiusOffset) * sinDeg(t) - canvWidth / 2;
        rect_y = ctr.y - (canvRadius - radiusOffset) * cosDeg(t) - canvWidth / 2;
        rect_r = new Rect(
            rect_x,
            rect_y + 20,
            canvWidth,
            canvWidth
        )
        canvas.fillEllipse(rect_r)
    }
}

function formatExpRemainTime(timeRemain) {
    let processTimeTmp = parseInt(timeRemain / 60)
    let hour = parseInt(processTimeTmp / 60)
    let minute = parseInt(processTimeTmp % 60)
    let second = parseInt(timeRemain % 60)
    return [hour.toString().padStart(2, '0'), minute.toString().padStart(2, '0'), second.toString().padStart(2, '0')]
}

function sinDeg(deg) {
    return Math.sin((deg * Math.PI) / 180)
}

function cosDeg(deg) {
    return Math.cos((deg * Math.PI) / 180)
}

function randomStrGen(length) {
    let result = '';
    const characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
    const charactersLength = characters.length;
    for (var i = 0; i < length; i++) {
        result += characters.charAt(Math.floor(Math.random() * charactersLength));
    }
    return result;
}

async function getTime(time) {
    let hh = ~~(time / 3600)
    let mm = ~~((time % 3600) / 60)

    return hh + ":" + mm
}

async function getClock(time) {
    let timeNow = Date.now()
    let now = new Date(timeNow)
    let hoursNow = now.getHours()
    let minutesNow = now.getMinutes() * 60 * 1000
    let secondsNow = now.getSeconds() * 1000
    let timeRecovery = new Date(timeNow + time * 1000)

    let tillTommorow = (24 - hoursNow) * 3600 * 1000
    let tommorow = timeNow + tillTommorow - minutesNow - secondsNow

    let str = ""
    if (timeRecovery < tommorow) {
        str = "今日"
    } else if (timeRecovery - tommorow > 86400000) {
        str = `周${'日一二三四五六'.charAt(timeRecovery.getDay())}`
    } else {
        str = "明日"
    }

    return " " + str + timeRecovery.getHours() + "点" + timeRecovery.getMinutes() + "分"
}

